import React, { useState } from 'react'
import './CartItems.css'
import { ShopContext } from '../../Context/ShopContext'
import remove_icon from '../Assets/cart_cross_icon.png'

const CartItems = () => {
    const [cart, setCart] = useState(null);
    const [error, setError] = useState(null);
    const userId = localStorage.getItem('userId'); 

    useEffect(() => {
        if (!userId) {
          setError('User is not logged in');
          return;
        }
    
        // Fetch cart items for the user
        const fetchCart = async () => {
          try {
            const response = await fetch('http://localhost:5000/get-cart', {
              method: 'POST',
              headers: {
                'Content-Type': 'application/json',
              },
              body: JSON.stringify({ userId }), // Send the userId to the backend
            });
    
            const data = await response.json();
    
            if (response.ok) {
              setCart(data.cart);  // Set the cart data if the response is successful
            } else {
              setError(data.message || 'Error fetching cart');
            }
          } catch (error) {
            setError('Error fetching cart');
          }
        };
    
        fetchCart();
      }, [userId]);
    
      if (error) {
        return <div>{error}</div>;
    }
    
  return (
    <div className='cartitems'>
        <div className="cartitems-format-main">
            <p>Products</p>
            <p>Title</p>
            <p>Price</p>
            <p>Quantity</p>
            <p>Total</p>
            <p>Remove</p>
        </div>
        <hr />
        {cart.map((e)=>{
            return(
                <div>
                    <div className="cartitems-format cartitems-format-main">
                        <img className='carticon-product-icon' src={e.image} alt="" />
                        <p>{e.name}</p>
                        <p>${e.new_price}</p>
                        <button className='cartitems-quantity'>{cartItems[e.id]}</button>
                        <p>{e.new_price*cartItems[e.id]}</p>
                        <img className='cartitems-remove-icon' src={remove_icon} onClick={()=>{removeFromCart(e.id)}} alt="" />
                    </div>
                    <hr />
                </div>
            )})
        }
            
        <div className="cartitems-down">
            <div className="cartitems-total">
                <h1>Cart Total</h1>
                <div>
                    <div className="cartitems-total-item">
                        <p>Subtotal</p>
                        <p>${getTotalCartAmount()}</p>
                    </div>
                    <hr />
                    <div className="cartitems-total-item">
                        <p>Shipping Fee</p>
                        <p>Free</p>
                    </div>
                    <hr />
                    <div className="cartitems-total-item">
                        <h3>Total</h3>
                        <h3>${getTotalCartAmount()}</h3>
                    </div>
                </div>
                <button>PROCEED TO CHECKOUT</button>
            </div>
            <div className="cartitems-promocode">
                <p>If you have a promo code, Enter it here</p>
                <div className="cartitems-promobox">
                    <input type="text" placeholder='promo code' />
                    <button>Submit</button>
                </div>
            </div>
        </div>
    </div>
  )
}

export default CartItems
